  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(todos / todosPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <div  className='pagination'>
        {pageNumbers.map(number => (
            <a onClick={() => paginate(number)} href='!#'>
              {number}
            </a>
        ))}
